(function ($) {
	    var exec_m = function(){
   			var container = document.querySelector('#archive-blog-grid');
   			var msnry = new Masonry( container, {
   			// options...
   			itemSelector: '.content-blog-box',
   			columnWidth: 10,
   		    });
   		}
   	$(document).ready(function() {
   		exec_m();
   	    //console.log($('body').html());
   	    //hover destaque
   	    $('.post-destacado').on('mouseover',function(){
   	    	var _width = $(this).children('.hover-img').attr('width');
   	    	var _height = $(this).children('.hover-img').attr('height');
   	    	$(this).children('.hover-img').css('width',_width+'px');
   	    	$(this).children('.hover-img').css('height',_height+'px');
   	    	$(this).children('.default-img').hide();
   	    	$(this).children('.hover-img').show();
   	    	//console.log('hi');
   	    });
   	    $('.post-destacado').on('mouseout',function(){
   	    	$(this).children('.hover-img').hide();
   	    	$(this).children('.default-img').show();
   	    	//console.log('hi');
   	    });
   	    $('.post-destacado').each(function(){
   	    	 var _width = $(this).width();
   	    	 $(this).children('.footer').css('width',_width -20 + 'px');
   	    });
   	    exec_m();
   	    $('#slider-container').slick({
   	    	infinite: true,
   	    	slidesToShow: 2,
   	    	slidesToScroll: 1
   	    });
    });
    $(window).load(function(){
    	exec_m();
    });
}(jQuery));